import { AvatarWrapper } from "./style";
const Avatar = () => (
	<AvatarWrapper>
		<a href="https://codepen.io/MarioDesigns/">
			<img
				src="https://s3-us-west-2.amazonaws.com/s.cdpn.io/751678/skytsunami.png"
				alt="Skytsunami"
			/>
		</a>
	</AvatarWrapper>
);
export default Avatar;
